    const { name, bet, side } = location.state;

    console.log(name, bet, side);

    return (
        <svg viewBox="0 0 300 100" xmlns="http://www.w3.org/2000/svg" stroke="purple" stroke-width="1" fill="#52c5a8">
            <circle cx="50" cy="50" r="40" />
        </svg>
    );
}

export default Game;
